import React from "react";

const Auth = () => {
  return (
    <form>
      <Box display={flex}>
        <Typography>Login</Typography>
        <TextField variant="outlined" label="Name" />
        <TextField variant="outlined" label="E" />
        <TextField variant="outlined" label="Name" />
        <Button>Sumbit</Button>
        <Button>Change to signup</Button>
      </Box>
    </form>
  );
};

export default Auth;
